    "louisa-and-keithsburg-national-wildlife-refuge-narrative-report-may-to-august-1952",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Louisa and Keithsburg
    National Wildlife Refuges outlines Refuge accomplishments from May to August 1952.
    The report begins by summarizing the weather conditions, water conditions, and food
    and cover during this period. Wildlife- including migratory birds, upland game birds,
    big game animals, furbearers, raptors, and fish- is also covered. The Refuge development
    and maintenance section discusses physical developments. The public relations section
    of the report describes recreational uses, Refuge visitors, Refuge participation,
    hunting, fishing, and violations. Items of interest and N-R forms are attached.",nt"license_title":
